import React, {useState} from 'react';

const welcome = (props)=>{
    return(
        <div>
            <h1>{props.val}</h1>
        </div>
    );
}

class SignUp extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: "user",
        };
    }



    render(){
        return(
            <div>
                {welcome({val:"testing"})}
            </div>
        )
    }
}

export default SignUp;
